# Function to convert JSON data to text format
def json_to_txt(json_data, indent=0):
    text = ""
    for key, value in json_data.items():
        if isinstance(value, dict):
            text += f"{' ' * indent}{key}:\n{json_to_txt(value, indent + 4)}"
        elif isinstance(value, list):
            text += f"{' ' * indent}{key}:\n"
            for item in value:
                if isinstance(item, dict):
                    text += json_to_txt(item, indent + 4)
                else:
                    text += f"{' ' * (indent + 4)}- {item}\n"
        else:
            text += f"{' ' * indent}{key}: {value}\n"
    return text

# Writing each JSON object to a separate text file
for index, item in enumerate(data):
    sku = item.get("sku", "unknown_sku")
    filename = f'product_{sku}.txt'
    with open(filename, 'w') as txt_file:
        txt_file.write(json_to_txt(item))
    print(f"File created successfully: {filename}")